import "./styles.css";
import Navbar from "./components/Navbar";
import { Route, Routes } from "react-router-dom";
import Home from "./routes/Home";

export default function App(){
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={ <Home/>}/>
      </Routes>

      <Navbar/>

    </div>
  )
}
